// src/components/Dashboard/Dashboard.jsx
import React from 'react';
import "./style.css";

const Dashboard = ({ shopItems }) => {

  return (
    <div className='dashboard'>

      <div className='first'>

      </div>
      <div className='second'>
        <div className="table-container">
        <h2>Product table</h2>
        <table className="custom-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>price</th>
              <th>Modify</th>
              <th>Delete</th>
            </tr>
          </thead>
          <tbody>
            {shopItems.map((user) => (
              <tr key={user.id}>
                <td>#{user.id}</td>
                <td>{user.name}</td>
                <td>{user.price}</td>
                <td> <button onClick="" className="btn"><i class="fas fa-edit"></i> update</button></td>
                <td> <button onClick="" className="btn"><i class="fa-solid fa-trash"> </i></button></td>

              </tr>
            ))}
          </tbody>
        </table>
        </div>
        
      </div>



    </div>
  );
};

export default Dashboard;
